// import logo from './logo.svg';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import CadastroAtasComunicados from "./pages/CadastroAtasComunicados";
// import CondosList from './CondosList';
// import AtasComunicados from "./pages/AtasComunicados";

// function App() {
//   return (
//     <div>
//       <h1>Condo AI</h1>
//       <CondosList />
//       <AtasComunicados />
//     </div>
//   );
// }

const Home = () => (
  <div>
    <h1>Bem-vindo ao Condo AI</h1>
    <p>Selecione uma opção no menu acima.</p>
  </div>
);

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/cadastro-atas-comunicados">Cadastro de Atas e Comunicados</Link></li>
          </ul>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/cadastro-atas-comunicados" element={<CadastroAtasComunicados />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
